import React from "react";
import { NavLink } from "react-router-dom";
import "/img/logo-holly_nobg.png";

function Header() {
  return (
    <>
      <header className="header">
        <div className="header__logo">
          <img src="../img/logo-holly_nobg.png" alt="logo" />
        </div>
      </header>
    </>
  );
}

export default Header;
